import React from 'react';
import styled from 'styled-components';

export default function RecipeCard(props) {
  return (
    <Div> 
      <ul>
      <li> 
        { props.title }  
      </li>
      <li> 
        { props.image }  
      </li>
      <li> 
        { props.dishTypes }  
      </li>
      <li> 
        { props.diets }  
      </li>
      </ul>
    </Div>
  )
};

const Div = styled.div`
  position: relative; 

  width: 600px;
  background-color: green;
`;
